import './What.css';

const What = () => {
    return (
        <header className='header_what'>
            <div className='container'>
                <div className='row'>
                    <div className='header_content_what'>
                        <h1>WE MAKE COMPLEX CUSTOM APPLICATIONS IN A CLEAR WAY</h1>
                        <p>Our focus is on complex long-term web and mobile projects, in which we are fully responsible for the technical part, from planning a roadmap to deploying and maintaining applications.</p>
                    </div>

                </div>
            </div>
        </header>
    );
};

export default What;
